import { React } from "react";
import logo from "../photo.jpeg";
const About = () => {
  return (
    <section class="about-box" id="about">
      <h1 className="h1"> About ME </h1>
      <p>who i am</p>
      <div className="about">
        <div className="img-box-left">
          <img
            src={logo}
            alt="logo"
          />
        </div>

        <div className="box-right">
          <p>
            .</p>
        </div>
      </div>

    </section>
  )
}

export default About
